import React  from "react";
import "./try.css"

function TelvinExample1() {
    return(

        <div>
            <div>
                <h1></h1>
                <img  src="https://img.freepik.com/premium-photo/abundance-ful-fruit-perfect-dessert-basket-generated-by-ai_188544-14486.jpg?w=1060" alt="heading" class="h-200 px-40  size " />
            </div>
            <h3 class="text-center ">You Can Taste, Trust You Can Feel!</h3>
            <img src="https://patilkaki.com/assets/home-brand-d34a5207.png" alt="delivery" class="px-64 "  />
        </div>

    )
}

export default TelvinExample1;
